import "./closeFriend.css"

export default function CloseFriend({user}) {
  let u = user;
  return (
    <li className="sidebarFriend">
    <img className="sidebarFriendImg" src={u.profilePicture} alt="" />
    <span className="sidebarFriendName">{u.username}</span>
  </li>
  )
}
